import verctor1Logo from '../../../assets/images/Vector1.svg';
import './cart.css';

const Cart = () => {
    return (
        <React.Fragment>
           <div className="cart"><img src={verctor1Logo} /><span className="itemCount"> 3 </span></div> 

        </React.Fragment>
    )
}

export default Cart;
